import React from "react"
import PropTypes from "prop-types"
import Box from "./Box"
import './css/index.css'

import axios from 'axios';

function BoxOwnerList(props) {

  const deleteBox = (id) => {
    console.log('delete box: ' + id)

    axios.delete(`/ajax_delete`, {data: {id}})
    .then(res => {
      if (res.data.success) {
        window.location.href = '/box'
      } else {
        // TODO: Handle error and display message to the user
      }
    })
  }

  return (
    <React.Fragment>
      <div>
        Total Boxes: {props.total}
      </div>

      {props.boxes && (
        props.boxes.map((box) => (
          <div key={`info-${box.id}`}  className='box'>
            <Box key={box.id} size={box.size} label={box.label} />

            <div key={`id-${box.id}`}>
              ID: {box.id}
            </div>

            <div className='deleteButton'>
              <button key={`delete-${box.id}`} onClick={() => deleteBox(box.id)}>Delete</button>
            </div>
          </div>
        ))
      )}
    </React.Fragment>
  );
}

BoxList.propTypes = {
  boxes: PropTypes.array,
  total: PropTypes.number
};
export default BoxList
